import React, { Component } from "react";
import { Animated } from "react-animated-css";

class header extends Component {
  render() {
    return (
      <header id="home">
        {/* NAVBAR */}
        <nav className="navbar navbar-expand-lg fixed-top sticky">
          <div className="container">
            <a className="navbar-brand logo" href="JaeKim.php">
              <img src="../images/name_light.png" alt="" className="img-fluid logo-light"></img>
            </a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarCollapse"
              aria-controls="navbarCollapse" aria-expanded="false" aria-label="Toggle navigation">
              <i className="fas fa-bars"></i>
            </button>
            <div className="collapse navbar-collapse" id="navbarCollapse">
              <ul className="navbar-nav ml-auto">
                <li className="nav-item active">
                  <a href="#home" className="nav-link">Home</a>
                </li>
                <li className="nav-item">
                  <a href="#about" className="nav-link">About</a>
                </li>
                <li className="nav-item">
                  <a href="#work" className="nav-link">Current Projects</a>
                </li>
                <li className="nav-item">
                  <a href="#contact" className="nav-link">Contact</a>
                </li>
              </ul>
            </div>
          </div>
        </nav>
        {/* NAVBAR END */}

      </header >
    );
  }
}

export default header;
